import {useState} from "react";
import {connect} from "react-redux";


let index = 334443128;

const Type_number = (props) =>{
    const [inx,setInx] = useState(props.numberMain);
    //console.log(index);
    const changeMinus = () => {
        setInx(inx-1);
    }
    const changePlus = () => {
        setInx(inx+1);
    }
    let baseUrl = `https://cdn3.riastatic.com/photosnew/auto/photo/__${inx}f.jpg`;
    return (
        <>
            <div className='Car_app'>
                <img src={baseUrl} alt="noImg"/>
                <div className='Car_app_align_button'>
                    <button onClick={() => changeMinus()}>Left</button>
                    <button onClick={() => changePlus()}>Right</button>

                </div>
                <button onClick={() => changePlus()}>Right</button>
                <button onClick={() => changePlus()}>Right</button>
                <button onClick={() => changePlus()}>Right</button>

            </div>
        </>
    );
}
let MapStateToProps = (state) =>( {
    numberMain: state.showPage.MainNumberURL
})
export let TypeContainer = connect(MapStateToProps,{})(Type_number);
